    return (
      <div class="container-fluid">
        <div class="text-center">
            <h1>My calculator</h1>
        </div>
        <ChooseOperation></ChooseOperation>

        <div class="row">
          <CalcBlock></CalcBlock>
        </div>
      </div>
    );
  }
}
export default App;
